class Nav extends React.Component {
    // eslint-disable-next-line no-useless-constructor
    constructor(props) {
        super(props);
    }

    render() {
        return(
            <div className={style.navDiv}>
                <SearchBar onSearch={this.props.onSearch} />
                <button className={style.btnHome}><Link to="/home">üè†Home</Link></button>  
                <button className={style.btnFavorites}><Link to="favorites">Favorites</Link></button>
                <button className={style.btnAbout}><Link to="/about">üíªAbout</Link>  </button>                                                                   
                <button className={style.btnLogout}><Link to="/">üîöLOGOUT</Link></button>
            </div>
        );
    }
}

export default Nav;
